    constructor(props) {
        super(props);

        this.state = {
            username: '',
            password: '',
            data:'',
        };
    }

    handleInputChange = e => {
        this.setState({
            [e.target.name]: e.target.value,
        });
    };

    handleSubmit = e => {
        e.preventDefault();

        // console.log("happy")
        const { username , password } = this.state;


